"ACS five-year estimate of the number of Households with 1+ Persons with a Disability in the geographic area. The U.S. Census Bureau defines disability broadly as difficulty with one of the following six basic areas of functioning–ambulation, cognition, hearing, independent living, self-care, and vision. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"dataCollectionsCalculator.PETSPETPRODUCTSMP26004H_B":{"id":"MP26004H_B","fullName":"PetsPetProducts.MP26004H_B","alias":"2023 HH Owns Dog","fieldName":"PETSPETPRODUCTSMP26004H_B","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.PETSPETPRODUCTSMP26004H_B","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-MRI-Simmons","definition":"Esri 2023 estimate of the expected number of households and Market Potential Index (MPI) for <em>Owns Dog</em> in the geographic area. Esri’s Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 80 this implies that consumer demand in the geographic area is likely to be 20% less than the U.S. average. Sources: Esri and MRI Simmons. See <a target='_blank' href='https://links.esri.com/demographics/market-potential'>Market Potential data</a> for more information."},"dataCollectionsCalculator.HOUSINGHOUSEHOLDX3044_X_A":{"id":"X3044_X_A","fullName":"HousingHousehold.X3044_X_A","alias":"2023 Insurance (Owner/Renter): Average","fieldName":"HOUSINGHOUSEHOLDX3044_X_A","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGHOUSEHOLDX3044_X_A","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-U.S. BLS","definition":"Esri 2023 estimates of the total (aggregate) amount spent, average amount spent per household, and Spending Potential Index (SPI) on <em>Insurance (Owner & Renter)</em> in the geographic area. Includes expected spending on both homeowner's and tenant's insurance combined. Esri’s Consumer Spending data provides information about the estimated spending by households for goods and services in an area. The aggregate value represents the total amount spent by all households. The average value represents the typical amount spent per household. The SPI compares average local expenditures to U.S. levels. The SPI value for the U.S. is 100. If, for example, the SPI value for a geographic area is 120 this implies that average spending by consumers in the geographic area is likely to be 20 percent more than the U.S. average. Sources: Esri and Bureau of Labor Statistics. See <a target='_blank' href='https://links.esri.com/demographics/consumer-spending'>Consumer Spending data</a> for more information."},"dataCollectionsCalculator.CUSTOM47F2931E95C64029B2BAF828AD062F24":{"id":"CUSTOM47F2931E95C64029B2BAF828AD062F24","fullName":"dataCollectionsCalculator.CUSTOM47F2931E95C64029B2BAF828AD062F24","alias":"Pop under 18 (%)","fieldName":"CUSTOM47F2931E95C64029B2BAF828AD062F24","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.CUSTOM47F2931E95C64029B2BAF828AD062F24","type":"esriFieldTypeDouble","usedFields":["_1YEARINCREMENTSAGE0_CY_P","_1YEARINCREMENTSAGE1_CY_P","_1YEARINCREMENTSAGE2_CY_P","_1YEARINCREMENTSAGE3_CY_P","_1YEARINCREMENTSAGE4_CY_P","_1YEARINCREMENTSAGE5_CY_P","_1YEARINCREMENTSAGE6_CY_P","_1YEARINCREMENTSAGE7_CY_P","_1YEARINCREMENTSAGE8_CY_P","_1YEARINCREMENTSAGE9_CY_P","_1YEARINCREMENTSAGE10_CY_P","_1YEARINCREMENTSAGE11_CY_P","_1YEARINCREMENTSAGE12_CY_P","_1YE
